"use strict";

import SvgIcon from "../../SvgIcon";
import { complete } from "../../svgDefinitions";

/**
 * The Complete icon class constructor
 * @class Complete
 * @extends SvgIcon
 */
export default class Complete extends SvgIcon {
    /**
     * @inheritDoc
     */
    get _name() {
        return "Complete";
    }

    /**
     * @inheritDoc
     */
    initialProps() {
        const props = super.initialProps();
        return Object.assign(props, {
            defaultClassNames: `${props.defaultClassNames} mpageui-SvgIcon-status-complete`
        });
    }

    /**
     * @inheritDoc
     */
    getSvg() {
        return complete;
    }
}
